import React from 'react';
import styled from 'styled-components';
import MenuIcon from '@material-ui/icons/Menu';


function Header() {
  return (
   <Container>
     <a>
       <img src="/images/logo.svg" alt=''/>
     </a>
     <Menu>
      <a href="#">Model S</a>
     <a href="#">Model 3</a>
      <a href="#">Model X</a>
      <a href="#">Model Y</a>
     </Menu>
     <RightMenu>
     <a href="#">Shop</a>
     <a href="#">Tesla Account</a>
        <CustomMenu/>
     </RightMenu>
     <BurgerNav>
       <li><a href='#'>Existing Inventory</a></li>
       <li><a href='#'>Used Inventory</a></li>
       <li><a href='#'>Trade-in</a></li>
       <li><a href='#'>CyberTruck</a></li>
       <li><a href='#'>Roadster</a></li>
       <li><a href='#'></a></li>
       <li><a href='#'></a></li>
       <li><a href='#'></a></li>
     </BurgerNav>
   </Container>
  )
}

export default Header

const Container = styled.div`
min-height: 60px;
position: fixed;
display: flex;
align-items: center;
justify-content: space-between;
padding: 0 20px;

//it will expand the header with the full width
top: 0;
left: 0;
right: 0;
`

const Menu = styled.div`
display: flex;
align-items: center;
justify-content: center;
flex: 1;

a {
  font-weight: 600;
  text-transform: uppercase;
  padding: 0 10px;
  flex-wrap: nowrap;
}

@media(max-width: 768px){
  display: none;
}
`

const RightMenu = styled.div`
display: flex;
align-items: center;

a {
  font-weight: 600;
  text-transform: uppercase;
  margin-right: 10px;
}
`

const CustomMenu = styled(MenuIcon)`
  cursor: pointer;
`

const BurgerNav = styled.div`
position: fixed;
top: 0;
bottom: 0;
right: 0;
background: white;
width: 30%;
`
